import React from 'react';
import { css } from 'glamor'

const NewsItem = ({item}) => {

    let news_item = css({
        padding: '200px',
        boxSizing: 'border-box',
        borderBottom: '1px solid grey'
    })

    return (
        <div>
        <h3>{item.title}</h3>
        <div>
            {item.feed}
        </div>
    </div>
    )
}

export default NewsItem;
